import React from 'react';
import { useNavigate } from 'react-router-dom';
import { getUser, removeUserSession } from './Utils/Common';
import { TimeoutLogic } from './Utils/TimeoutLogic';
const[log,setLog]=useState(false)

function Dashboard(props) {
  const user = getUser();

const navigate=useNavigate();

  const handleLogout = () => {
    removeUserSession();
    navigate('/');
  }

  return (
    <div className='container log bg-dark text-white'>
      Welcome to Dashboard {user.name}!<br /><br />
      <input type="button" className=' btn btn-primary' onClick={handleLogout} value="Logout" />
      <TimeoutLogic/>
    </div>
  );
}

export default Dashboard;
